// The FlatBuffers schema for making Firebase Auth rpc request. The order does
// not matter since we do not store nor send serialized object. Table Request
// mainly provides each field name with type for generating request JSON string.
// For a particular request type, not all fields are relevant.

namespace firebase.auth.fbs;

table Request {
  email:string;
  password:string;
  displayName:string;
  returnSecureToken:bool;

  identifier:string;
  continueUri:string;

  localId:string;
  accessToken:string;

  idToken:string;

  requestUri:string;
  postBody:string;
  providerId:string;
  oAuthSecret:string;

  requestType:string;

  oobCode:string;
  newPassword:string;

  appToken:string;
  isSandbox:bool;

  token:string;

  grantType:string;
  code:string;
  refreshToken:string;

  photoUrl:string;
  deleteAttribute:[string];
  deleteProvider:[string];
}

root_type Request;

