// The FlatBuffers schema for Firebase Auth rpc response. The order does not
// matter since we do not store nor receive serialized object. Table Response
// mainly provides each field name with type for parsing response JSON string.
// For a particular response type, not all fields are set. In addition, for a
// particular response type, extra fields not specified in table Response are
// irrelevant to our SDK and thus simply ignored.

namespace firebase.auth.fbs;

table ProviderUserInfo {
  providerId:string;
  displayName:string;
  photoUrl:string;
  federatedId:string;
  email:string;
  phoneNumber:string;
}

table User {
  localId:string;
  displayName:string;
  email:string;
  photoUrl:string;
  emailVerified:bool;
  passwordHash:string;
  phoneNumber:string;
  passwordUpdatedAt:double;
  validSince:long; // Note: the format here is seconds.
  lastLoginAt:long;
  createdAt:long;
  providerUserInfo:[ProviderUserInfo];
}

table ErrorDetails {
  reason:string;
}

table Error {
  code:long;
  message:string;
  errors:[ErrorDetails];
}

table Response {
  kind:string;
  idToken:string;
  refreshToken:string;
  expiresIn:string;
  localId:string;

  allProviders:[string];
  registered:bool;

  users:[User];

  receipt:string;

  displayName:string;
  email:string;
  photoUrl:string;

  access_token:string;
  refresh_token:string;
  id_token:string;
  expires_in:string;

  isNewUser:bool;

  passwordHash:string;

  providerId:string;
  rawUserInfo:string;

  providerUserInfo:[ProviderUserInfo];

  needConfirmation: bool;

  error:Error;
}

root_type Response;

